import React from 'react'
import {data} from "../../store/store";
import s from "./Product.module.css"



class Product extends React.Component{
    constructor (){
        super();

        this.state = {
            qty: data
        }
    }
    render() {
        console.log(this);
        let title = this.state.qty.map((title) => <div>{title.title}</div>);
        let picture = this.state.qty.map((picture) => <img srs={picture.image_main}/>);
        return (
            <div className="container-block">
                <header className="App-header">
                    <div>{picture}</div>
                    <div>{title}</div>
                </header>
            </div>
        );
    }

}



export default Product;
